import sys

def main():
    line = sys.stdin.readline()
    line = line.rstrip().split()
    a = int(line[0])
    b = int(line[1])
    if a == b:
        print("Draw")
        return
    if a == 1:
        print("Alice")
        return
    if b == 1:
        print("Bob")
        return
    if a < b:
        print("Alice")
        return
    if a > b:
        print("Bob")
        return

if __name__ == "__main__":
    main()

